import React, { Component } from "react";
import DataService from "../Services/WebUserJobService";
import { Link } from "react-router-dom";

  export default class AllJobsList extends Component {
    constructor(props) {
      super(props);
      
      this.state = {
        categories: []
      };
    }

  componentDidMount() {
    DataService.getJobCategory().then((res) =>{
      this.setState({jobs:res.data});
    });
  }

  render(){
    const{categories} = this.state;
    return(
      <div>
        <h2 className="text-center">Jobs per Category</h2>
        <div className="row">
        <table className = "table table-striped table-bordered">
            <thead>
              <tr>

                <th>Job Industry</th>
                <th>Job Count</th>
               
              </tr>
            </thead>
            <tbody>
              {
                this.state.categories.map((item, index) => 
                <tr key = {job.jobid}>
                  <td>{job.jobTitle}</td>
                  <td>{job.jobIndustry}</td>
                </tr>  
                  )
              }
            </tbody>
  
          </table>
        <div>
      {this.state.categories.map((item, index) => (
        <li key={index}>{item.text}</li>
      ))}
    </div>
        
          
        </div>
  
      </div>
    );
  
  }

}
